import React, { Component} from 'react';
import ThumbnailStyles from './style';
import Link from 'next/link';


class Thumbnail extends Component{
    render(){
        const {imageUrl = "https://via.placeholder.com/210x295?text=not%20availble", caption} = this.props; 
        return (
            <div className="thumbnail">
                <Link><a>
                    <img src={imageUrl} className="thumbnail_image"/>
                    <h3 className="thumbnail_caption">{caption}</h3>
                </a></Link>
                <style jsx>{ThumbnailStyles }</style>
            </div>
        );
    }
}



export default Thumbnail;
